import { Injectable } from '@angular/core';
import { Logger } from 'src/app/services/logging/logger-base';

@Injectable()
export class NotificationSoundsService {
    private readonly loggerPrefix = '[NotificationSoundsService] -';
    constructor(private logger: Logger) {}

    private hearingStartingSound =
        '';

    private consultationSound =
        '';

    consultationRequestSound: HTMLAudioElement;
    consultationRequestSoundAssets: HTMLAudioElement;

    hearingStartingAnnounced: boolean;
    currentPlayCount: number;
    hearingAlertSound: HTMLAudioElement;
    hearingAlertSoundAsset: HTMLAudioElement;
    consultationAlertSoundAsset: HTMLAudioElement;

    hearingAlertPlayCount: number;

    initConsultationRequestRingtone(): void {
        this.consultationRequestSound = new Audio();
        this.consultationRequestSound.src = `data:audio/mpeg;base64,${this.consultationSound}`;
        this.consultationRequestSound.load();
        this.consultationRequestSound.addEventListener(
            'ended',
            function () {
                this.play();
            },
            false
        );
    }

    async playConsultationRequestRingtone() {
        await this.consultationRequestSound.play().catch(err => {
            this.logger.error(`${this.loggerPrefix} failed to play consultation request ringtone`, err, {
                errorMessage: this.consultationRequestSound.error
            });
        });
    }

    stopConsultationRequestRingtone() {
        this.consultationRequestSound.pause();
        this.consultationRequestSound.currentTime = 0;
    }

    playHearingAlertSound() {
        if (!this.hearingAlertSound) {
            this.initHearingAlertSound();
        }
        if (this.hearingAlertPlayCount >= 3) {
            this.hearingAlertPlayCount = 1;
        }
        this.logger.debug(`${this.loggerPrefix} playing hearing starting sound`);
        return this.hearingAlertSound.play().catch(err => {
            this.logger.error(`${this.loggerPrefix} failed to play hearing alert sound`, err, {
                errorMessage: this.hearingAlertSound.error
            });
        });
    }

    stopHearingAlertSound() {
        this.hearingAlertSound.pause();
        this.hearingAlertSound.currentTime = 0;
        this.hearingAlertPlayCount = 1;
    }

    initHearingAlertSound() {
        this.hearingAlertPlayCount = 1;
        this.hearingAlertSound = new Audio();
        this.hearingAlertSound.src = `data:audio/mpeg;base64,${this.hearingStartingSound}`;
        this.hearingAlertSound.load();
        const self = this;
        this.hearingAlertSound.addEventListener(
            'ended',
            function () {
                self.hearingAlertPlayCount++;
                if (self.hearingAlertPlayCount <= 3) {
                    this.play();
                }
            },
            false
        );
    }

    initHearingSoundAlertAsset() {
        this.hearingAlertSoundAsset = new Audio();
        fetch('/assets/audio/hearing_starting_soon.txt').then(async val => {
            const encoded = await val.text();
            this.hearingAlertSoundAsset.src = `data:audio/mpeg;base64,${encoded}`;
            this.hearingAlertSoundAsset.load();
        });
    }

    playHearingAlertSoundFromAsset() {
        this.logger.debug(`${this.loggerPrefix} playing hearing starting sound from asset`);
        return this.hearingAlertSoundAsset.play().catch(err => {
            this.logger.error(`${this.loggerPrefix} failed to play hearing alert sound`, err, {
                errorMessage: this.hearingAlertSound.error
            });
        });
    }

    initConsultationSoundAlertAsset() {
        this.consultationAlertSoundAsset = new Audio();
        fetch('/assets/audio/consultation_request.txt').then(async val => {
            const encoded = await val.text();
            this.consultationAlertSoundAsset.src = `data:audio/mpeg;base64,${encoded}`;
            this.consultationAlertSoundAsset.load();
        });
    }

    playConsultationAlertSoundFromAsset() {
        this.logger.debug(`${this.loggerPrefix} playing consultation call sound from asset`);
        return this.consultationAlertSoundAsset.play().catch(err => {
            this.logger.error(`${this.loggerPrefix} failed to play consultation sound alert sound`, err, {
                errorMessage: this.hearingAlertSound.error
            });
        });
    }
}
